import { FcCheckmark } from "react-icons/fc";
import styled from 'styled-components';

const TaskList = (props) => {
  const { tasks } = props;

  return (
    <ul>
      {tasks.map((task) => {
        return (
          <li key={task.id} style={{ marginBottom: 8 }}>
            <span>{task.title}</span>
            <FcCheckmark />
          </li>
        );
      })}
    </ul>
  );
};

export default TaskList;
